import React from 'react';
import classes from './Meal.module.css';

//食物组件
const Meal = () => {
	return (
		<div className={classes.Meal}>
         <div>
           <img src="../../../../public/img/" alt="" />
         </div>
		</div>
	);
};

export default Meal;
